import{_ as e,o as a,c as r,O as i}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 3.2-6523 Inoculation for rabies at public or private animal shelters.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-6523.md","filePath":"vacode/3.2-6523.md"}'),t={name:"vacode/3.2-6523.md"},n=i('<h1 id="§-3-2-6523-inoculation-for-rabies-at-public-or-private-animal-shelters" tabindex="-1">§ 3.2-6523 Inoculation for rabies at public or private animal shelters. <a class="header-anchor" href="#§-3-2-6523-inoculation-for-rabies-at-public-or-private-animal-shelters" aria-label="Permalink to &quot;§ 3.2-6523 Inoculation for rabies at public or private animal shelters.&quot;">​</a></h1><p>Dogs and cats being adopted from a public or private animal shelter during the period an emergency ordinance is in force, as provided for in § <a href="http://law.lis.virginia.gov/vacode/3.2-6522/" target="_blank" rel="noreferrer">3.2-6522</a>, may be inoculated for rabies by a certified animal technician at such shelter if the certified animal technician is under the immediate and direct supervision of a licensed veterinarian.</p><p>1984, c. 384, § 29-213.68:1; 1987, c. 488, § 3.1-796.99; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0148" target="_blank" rel="noreferrer">148</a>.</p>',3),o=[n];function c(l,s,d,p,_,f){return a(),r("div",null,o)}const m=e(t,[["render",c]]);export{u as __pageData,m as default};
